func OwnerIDIn(vs ...uuid.UUID) predicate.LabelTemplate {
	return predicate.LabelTemplate(sql.FieldIn(FieldOwnerID, vs...))
}

// OwnerIDNotIn applies the NotIn predicate on the "owner_id" field.
